import { OperationsZonesImplementService } from '../../../../implements/operations-zones-implement.service';
import { DialogConfirmChangesService } from '@molecules/dialog/views/dialog-confirmate-changes/dialog-confirm-changes.service';
import { AlertService } from '@molecules/alert/alert.service';
import { CDeliveryServiceTypeRoute, EDeliveryServiceType } from '@models/service-type/delivery-service-type.model';
import { ZoneDetail } from '../../../../models/operations-zones.model';
import { Subscription } from 'rxjs';
import { IZoneBackupUpdate } from '@interfaces/zones/zones.interface';
import { parseUrl } from '@helpers/parse-url.helper';
import { CONCAT_PATH } from '@parameters/router/concat-path.parameter';
import { ZoneBackupServiceType, ZoneServiceType } from '../../../../models/operations-zones-service-type.model';
import { OperationMessages } from '../../../../../../parameters/operations-messages.parameter';

@Component({
    selector: 'app-operations-zones-edition-backup-service-type',
    templateUrl: './operations-zones-edition-backup-service-type.component.html',
    styleUrls: ['./operations-zones-edition-backup-service-type.component.sass']
})
export class OperationsZonesEditionBackupServiceTypeComponent implements OnInit, OnDestroy {
    private subscriptions: Subscription[] = [];
    public zoneDetail: ZoneDetail;
    public zoneBackupDetail: ZoneDetail;
    public serviceType: EDeliveryServiceType;
    public zoneBackupServiceType: ZoneBackupServiceType;

    public backupServiceTypeEditionLoader = true;
    public saveEditionLoader: boolean;

    constructor(
        private _router: Router,
        private _activatedRoute: ActivatedRoute,
        @SkipSelf() private _operationsZonesEditionStore: OperationsZonesEditionStoreService,
        private _operationsZonesImplement: OperationsZonesImplementService,
        private _dialogConfirmChanges: DialogConfirmChangesService,
        private _alert: AlertService
    ) {
    }

    ngOnInit(): void {
        this.getZoneDetail();
        this.getZoneBackupDetail();
        const path = this._activatedRoute.snapshot.routeConfig.path;
        this.serviceType = Object.keys(CDeliveryServiceTypeRoute)
            .find((key) => path.includes(CDeliveryServiceTypeRoute[key])) as EDeliveryServiceType;
        this.setZoneBackupServiceType();
    }


    getZoneDetail() {
        const subscription = this._operationsZonesEditionStore.zoneDetail$
            .subscribe((zoneDetail: ZoneDetail) => {
                this.zoneDetail = zoneDetail;
            }, () => {
                this.zoneDetail = null;
                this.backupServiceTypeEditionLoader = false;
            });
        this.subscriptions.push(subscription);
    }

    getZoneBackupDetail() {
        const subscription = this._operationsZonesEditionStore.zoneBackup$
            .subscribe((zoneBackupDetail: ZoneDetail) => {
                this.zoneBackupDetail = zoneBackupDetail;
                this.setZoneBackupServiceType();
            }, () => {
                this.zoneBackupDetail = null;
                this.backupServiceTypeEditionLoader = false;
            });
        this.subscriptions.push(subscription);
    }

    private setZoneBackupServiceType() {
        const zoneServiceType = this.zoneBackupDetail?.serviceTypeList
            .find((serviceType: ZoneServiceType) => serviceType.code === this.serviceType);
        const forceService = this.serviceType === EDeliveryServiceType.amPm ?
            this.zoneDetail?.zoneBackup?.forceServiceAMPM : this.zoneDetail?.zoneBackup?.forceServiceSCHEDULED;
        this.zoneBackupServiceType = zoneServiceType ? new ZoneBackupServiceType(zoneServiceType, forceService) : null;
        this.backupServiceTypeEditionLoader = !this.zoneBackupServiceType;
    }

    putBackupServiceType(zoneBackupUpdate: IZoneBackupUpdate) {
        this._operationsZonesImplement.putZoneBackup(
            this.zoneDetail.code, zoneBackupUpdate)
            .subscribe(() => {
                this._operationsZonesEditionStore.updateZoneDetail = true;
                this._alert.alertSuccess(OperationMessages.successOperationEdition(this.zoneDetail.name));
                this.backRoute();
            }, () => {
                this._alert.alertError(OperationMessages.errorOperationEdition(this.zoneDetail.name));
                this.backRoute();
            });
    }

    cancelEdition() {
        this.backRoute();
    }

    saveEdition(zoneBackupUpdate: IZoneBackupUpdate) {
        this.saveEditionLoader = true;
        const subscription = this._dialogConfirmChanges.open()
            .afterClosed()
            .subscribe((confirmChanges) => {
                if (confirmChanges) {
                    this.putBackupServiceType(zoneBackupUpdate);
                } else {
                    this.saveEditionLoader = false;
                }
            });
        this.subscriptions.push(subscription);
    }

    backRoute() {
        const backRoute = parseUrl(this._router.url, '..');
        this._router.navigate([backRoute]);
    }

    zoneListRoute() {
        this._router.navigate([CONCAT_PATH.operationZones]);
    }

    ngOnDestroy() {
        this.subscriptions.forEach(subscription => subscription.unsubscribe());
    }
}

import { Component, OnDestroy, OnInit } from '@angular/core';
import { OperationsZonesEditionStoreService } from './stores/operations-zones-edition-store.service';
import { ActivatedRoute } from '@angular/router';
import { OperationsZonesImplementService } from '../../implements/operations-zones-implement.service';
import { OP_ZONES_PATH } from '@parameters/router/router-path.parameter';
import { ZoneDetail } from '../../models/operations-zones.model';
import { Subscription } from 'rxjs';

@Component({
    template: '<router-outlet></router-outlet>',
    providers: [OperationsZonesEditionStoreService]
})
export class OperationsZonesEditionComponent implements OnInit, OnDestroy {
    private subscriptions: Subscription[] = [];
    private zoneCode: string;

    constructor(
        private _activatedRoute: ActivatedRoute,
        private _operationsZonesImplement: OperationsZonesImplementService,
        private _operationsZonesEditionStore: OperationsZonesEditionStoreService,
    ) {
    }

    ngOnInit(): void {
        const subscription = this._activatedRoute.paramMap.subscribe(() => {
            this.zoneCode = this._activatedRoute.snapshot.params[OP_ZONES_PATH.zoneCode];
            this._operationsZonesEditionStore.updateZoneDetail = true;
        });
        this.updateZoneDetail();
        this.subscriptions.push(subscription);
    }

    getZoneDetail(zoneCode: string) {
        this._operationsZonesImplement.getZoneDetail(zoneCode)
            .subscribe((zoneDetail: ZoneDetail) => {
                this._operationsZonesEditionStore.zoneDetail = zoneDetail;
                if (zoneDetail.zoneBackup) {
                    this.getZoneBackup(zoneDetail.zoneBackup.code);
                }
            }, (error) => {
                this._operationsZonesEditionStore.zoneDetailError = error;
            });
    }

    updateZoneDetail() {
        const subscription = this._operationsZonesEditionStore.updateZoneDetail$
            .subscribe(() => {
                this.getZoneDetail(this.zoneCode);
            });
        this.subscriptions.push(subscription);
    }

    getZoneBackup(zoneCode: string) {
        this._operationsZonesImplement.getZoneDetail(zoneCode)
            .subscribe((zoneDetail: ZoneDetail) => {
                this._operationsZonesEditionStore.zoneBackup = zoneDetail;
            }, (error) => {
                this._operationsZonesEditionStore.zoneBackupError = error;
            });
    }

    ngOnDestroy() {
        this.subscriptions.forEach(subscription => subscription.unsubscribe());
    }

}

import { Component, OnDestroy, OnInit, SkipSelf } from '@angular/core';
import { Router } from '@angular/router';
import { Subscription } from 'rxjs';
import { ZoneDetail } from '../../../../models/operations-zones.model';
import { CONCAT_PATH } from '@parameters/router/concat-path.parameter';
import { CDeliveryServiceTypeName, CDeliveryServiceTypeRoute, EDeliveryServiceType } from '@models/service-type/delivery-service-type.model';
import { ZoneBackupServiceTypeList, ZoneServiceTypeList } from '../../../../models/operations-zones-service-type.model';
import { OperationsZonesEditionStoreService } from '../../stores/operations-zones-edition-store.service';
import { DialogConfirmChangesService } from '@molecules/dialog/views/dialog-confirmate-changes/dialog-confirm-changes.service';
import { OperationsZonesImplementService } from '../../../../implements/operations-zones-implement.service';
import { IZoneServiceTypeRegister } from '@interfaces/zones/zones.interface';
import { DatesHelper } from '@helpers/dates.helper';
import { DATES_FORMAT } from '@parameters/dates-format.parameters';
import { OperationMessages } from '../../../../../../parameters/operations-messages.parameter';
import { AlertService } from '@molecules/alert/alert.service';
import { parseUrl } from '@helpers/parse-url.helper';
import { ZonesStoreServiceType } from '../../../../models/operations-zones-store.model';

@Component({
    selector: 'app-operations-zones-edition-home',
    templateUrl: './operations-zones-edition-home.component.html',
    styleUrls: ['./operations-zones-edition-home.component.sass']
})
export class OperationsZonesEditionHomeComponent implements OnInit, OnDestroy {
    private subscriptions: Subscription[] = [];
    private serviceTypeName = CDeliveryServiceTypeName;
    public deliveryServiceType = EDeliveryServiceType;

    public zoneDetail: ZoneDetail;
    public zoneServiceTypeList: ZoneServiceTypeList;
    public zoneBackupDetail: ZoneDetail;
    public zoneBackupServiceTypeList: ZoneBackupServiceTypeList = new ZoneBackupServiceTypeList([]);

    public homeEditionLoader = true;
    public saveEditionLoader: boolean;

    constructor(
        private _router: Router,
        @SkipSelf() private _operationsZonesEditionStore: OperationsZonesEditionStoreService,
        private _dialogConfirmChanges: DialogConfirmChangesService,
        private _operationsZonesImplement: OperationsZonesImplementService,
        private _alert: AlertService
    ) {
    }

    ngOnInit(): void {
        this.getZoneDetail();
        this.getZoneBackup();
    }

    getZoneDetail() {
        const subscription = this._operationsZonesEditionStore.zoneDetail$
            .subscribe((zoneDetail: ZoneDetail) => {
                    this.homeEditionLoader = false;
                    this.saveEditionLoader = false;
                    this.zoneDetail = zoneDetail;
                    this.zoneServiceTypeList = new ZoneServiceTypeList(zoneDetail.serviceTypeList, zoneDetail.assignedStore.serviceTypeList);
                },
                () => {
                    this.saveEditionLoader = false;
                    this.homeEditionLoader = false;
                    this.zoneDetail = null;
                    this.zoneServiceTypeList = null;
                });
        this.subscriptions.push(subscription);
    }

    getZoneBackup() {
        const subscription = this._operationsZonesEditionStore.zoneBackup$
            .subscribe((zoneBackupDetail: ZoneDetail) => {
                    this.zoneBackupDetail = zoneBackupDetail;
                    this.zoneBackupServiceTypeList = new ZoneBackupServiceTypeList(zoneBackupDetail.serviceTypeList, this.zoneDetail.zoneBackup);
                },
                () => {
                    this.zoneBackupDetail = null;
                    this.zoneBackupServiceTypeList = new ZoneBackupServiceTypeList([]);
                });
        this.subscriptions.push(subscription);
    }

    editZone() {
        this._router.navigate([CONCAT_PATH.opZones_ZoneEdition(this.zoneDetail.code)]);
    }

    editServiceType(serviceType: EDeliveryServiceType) {
        const zoneCodePath = CONCAT_PATH.opZones_ZoneCode(this.zoneDetail.code);
        const serviceTypePath = `${zoneCodePath}/${CDeliveryServiceTypeRoute[serviceType]}`;
        this._router.navigate([serviceTypePath]);
    }

    addServiceType(serviceType: EDeliveryServiceType) {
        const subscription = this._dialogConfirmChanges.open()
            .afterClosed()
            .subscribe((confirmChanges) => {
                if (confirmChanges) {
                    this.registerServiceType(serviceType);
                }
            });
        this.subscriptions.push(subscription);
    }

    registerServiceType(serviceType: EDeliveryServiceType) {
        const assignedStoreServiceType = this.zoneDetail?.assignedStore.serviceTypeList
            .find((storeServiceType: ZonesStoreServiceType) => storeServiceType.code === serviceType);

        if (assignedStoreServiceType) {
            const zoneServiceTypRegister = {
                serviceTypeCode: serviceType,
                startHour: DatesHelper.Date(assignedStoreServiceType.startHour, DATES_FORMAT.millisecond).format(DATES_FORMAT.hourMinuteSecond),
                endHour: DatesHelper.Date(assignedStoreServiceType.endHour, DATES_FORMAT.millisecond).format(DATES_FORMAT.hourMinuteSecond),
                segmentGap: '30',
                zoneId: this.zoneDetail.id
            } as IZoneServiceTypeRegister;

            this._operationsZonesImplement.postZoneServiceType(zoneServiceTypRegister)
                .subscribe(() => {
                    this.saveEditionLoader = true;
                    this._operationsZonesEditionStore.updateZoneDetail = true;
                    this._alert.alertSuccess(OperationMessages.successServiceTypeRegistered(this.serviceTypeName[serviceType], this.zoneDetail.name));
                }, () => {
                    this._alert.alertError(OperationMessages.errorServiceTypeRegistered(this.serviceTypeName[serviceType], this.zoneDetail.name));
                });
        } else {
            this._alert.alertError(OperationMessages.errorServiceTypeRegistered(this.serviceTypeName[serviceType], this.zoneDetail.name));
        }
    }

    editBackupZone() {
        this._router.navigate([CONCAT_PATH.opZones_ZoneBackupEdition(this.zoneDetail.code)]);
    }

    editBackupServiceType(serviceType: EDeliveryServiceType) {
        let serviceTypePath;
        switch (serviceType) {
            case EDeliveryServiceType.amPm:
                serviceTypePath = CONCAT_PATH.opZones_ZoneBackupAmPmEdition(this.zoneDetail.code);
                break;
            case EDeliveryServiceType.scheduled:
                serviceTypePath = CONCAT_PATH.opZones_ZoneBackupScheduledEdition(this.zoneDetail.code);
                break;
        }
        this._router.navigate([serviceTypePath]);
    }

    backRoute() {
        const backRoute = parseUrl(this._router.url, '..');
        this._router.navigate([backRoute]);
    }

    ngOnDestroy() {
        this.subscriptions.forEach(subscription => subscription.unsubscribe());
    }

}

